@marcglasberg Are you asking about the documentation for SDK elements referenced in your code? For example
```dart
  var x = TextField();
  x.autofillHints;
```
Then you put the cursor on `autofillHints` and type Ctrl-Q, right?

FWIW On my Mac if I just hover over `autofillHints I get the documentation as expected. Or, if I type Ctrl-J (which is bound to quick documentation on Mac) it shows that same panel.

